import React, { ReactElement } from 'react'
import styles from './index.module.css'




interface TabsNavProps {
    onChange: Function;
    focusesAndTypesOfSkillsArr: Object[];
}

type Writeable<T> = { 
    -readonly [N in keyof T]: T[N] extends string ? Writeable<T[N]> : T[N];
};

type MyWritable = Writeable<ReactElement>;


const TabsNav = (props: TabsNavProps) => {
    let TabsNavItemsHard: Array<MyWritable>= [];
    let TabsNavItemsSoft: Array<MyWritable> = [];

    const focusesAndTypesOfSkillsArr = props.focusesAndTypesOfSkillsArr


    const handleChange = (event: any) => {
        props.onChange(event.target.value);
        // TabsNavItemsHard.forEach((el) => {

        // })
        // event.target.className += ` ${styles.button_tab__active}`
    }

    const pushElemsToArrays = (arrDb: Object[], arrDest: Array<MyWritable>, i: number, indOfValue: number) =>  {
        arrDest.push(
            <button onClick={handleChange} className={`${styles.button_tag}`} value={`${Object.values(arrDb[i])[1]}`}>
            {Object.values(arrDb[i])[indOfValue]}
            </button>
        )
    }

    for(let i = 0; i < focusesAndTypesOfSkillsArr.length; i++) {
        if(Object.values(focusesAndTypesOfSkillsArr[i])[0] === 'Hard') {
            pushElemsToArrays(focusesAndTypesOfSkillsArr, TabsNavItemsHard, i, 1)
        } else {
            pushElemsToArrays(focusesAndTypesOfSkillsArr, TabsNavItemsSoft, i, 1)
        }
    }

  return (
    <div className={styles.main_menu}>
        <h2 className={styles.mySkills_title}>My skills</h2>
        <div className={styles.tab_list}>
            <h4 className={styles.skill_type}>
                HARD
            </h4>
                {TabsNavItemsHard}
        </div>
        <div className={styles.tab_list}>
            <h4 className={styles.skill_type}>
                SOFT
            </h4>
                {TabsNavItemsSoft}
        </div>
    </div>
  )
}

export default TabsNav
